manufacture_part_category=document.getElementById("manufacture_part_form_category");if(manufacture_part_category){manufacture_part_category.addEventListener("change",changeObjectCategory,false)}function changeObjectCategory(){let replaceId="manufacture_part_form_action";let incomingForm=document.forms.manufacture_part_form;document.getElementById(replaceId).disable=true;const requestModalName=new XMLHttpRequest;requestModalName.responseType="document";let formData=new FormData;formData.append(this.getAttribute("name"),this.value);requestModalName.open(incomingForm.getAttribute("method"),incomingForm.getAttribute("action"),true);requestModalName.setRequestHeader("X-Requested-With","XMLHttpRequest");requestModalName.addEventListener("readystatechange",(function(){if(requestModalName.readyState===4&&requestModalName.status===200){let result=requestModalName.response.getElementById(replaceId);document.getElementById(replaceId).replaceWith(result);let select2=document.getElementById(replaceId+"_select2");if(select2){select2.remove()}let replacer=document.getElementById(replaceId);if(replacer.tagName==="SELECT"){new NiceSelect(replacer,{searchable:true,id:"select2-"+replaceId})}}return false}));requestModalName.send(formData)}